import React from "react";

export default function Sidebar() {
  return (
    <div className="sidebar">
      <img src="/images/mask-group-8.png" alt="Icon 1" className="sidebar-icon" />
      <img src="/images/mask-group-8-2.png" alt="Icon 2" className="sidebar-icon" />
      <img src="/path/to/icon3.png" alt="Icon 3" className="sidebar-icon" />
      <img src="/path/to/icon4.png" alt="Icon 4" className="sidebar-icon" />
    </div>
  );
}
